var map;
var overlays = {};
var overids = {};
var fitBoundOpts = {animate:true};

function initMap(markerdata) {
  console.log(markerdata)
  maxBounds = new L.LatLngBounds(new L.LatLng(34.78,25.01), new L.LatLng(43.13,45.82))
  map = L.map('map',{
    maxBounds: maxBounds,
    zoom: 6,
    center: maxBounds.getCenter()
  })

  map.removeControl(map.zoomControl)
  L.control.zoom({position: 'topright'}).addTo(map);
  map.removeControl(map.attributionControl)
  L.control.attribution({position: 'bottomleft'}).addTo(map);
  map.setMaxBounds(maxBounds);

  sat2009.addTo(map)
  //var lControl = L.control.layers(baseMaps, {}, {collapsed:false}).addTo(map);

  /*var HomeButton = L.Control.extend({
    options: { position: 'topleft' }, 
    onAdd: function (map) {
      var container = L.DomUtil.create('div', 'home-button leaflet-bar leaflet-control');
      L.DomEvent.addListener(container, 'click', getBack);
      return container;
    }
  });
  map.addControl(new HomeButton());
  $('.home-button').html('<div class=""><span class="glyphicon glyphicon-home"></span></div>')*/

  markerLayer = L.featureGroup().addTo(map);
  polygonLayer = L.featureGroup().addTo(map);
  lineLayer = L.featureGroup().addTo(map);
  markers = {};
  $.each(markerdata, function(i,mark){
    img = "<div style='height:0px'>&nbsp;</div>"
    if (mark.logo.length > 0){
      img = "<div><img src='"+mark.logo+"' style='width:100%;height:auto;margin-bottom:0px'></div>"
    }
    
    popcontent = img+"<div class='mod' data-slug='"+mark.slug+"'><h4 class='maplink'>"+mark.name+"</h4><p>"+mark.description.split(".")[0]+"...</p></div><br/><div style='position:absolute;bottom:10px;right:12px;font-size:11px;cursor: pointer;' class='zom'><a class='zom' data-slug='"+mark.id+"'>Daha fazla bilgi</a></div>";
    popcontent += '';
    var marker = L.marker([mark.latitude, mark.longitude],{
      icon: L.icon({iconUrl:"/img/"+mark.icon+".svg",iconSize: [32,32]}),
      riseOnHover: true,
    }).addTo(markerLayer);
    marker.id = mark.id;
    marker.name = mark.name;
    marker.slug = mark.slug;
    marker.slug_en = mark.slug_en;
    marker.types = mark.types;
    dom = document.createElement('div');
    dom.innerHTML = popcontent;
    marker.bindPopup(dom);
    $(dom).find('div.zom').on('click tap',zom);
    markers[marker.id] = marker;
    //marker.on('click tap', function(e){ popUp(e.layer) });
  });
  map.fitBounds(markerLayer.getBounds());
  resize();
}

function resize() {
  $('#cats, #itms > ul ').jScrollPane();
}

$(window).on("resize",resize);

$(".cat").on("click",function(){
  slug = $(this).attr("id").replace(/^cat_/,"");
  title = $(this).find(".title").text().trim();
  html = "<h4 class='cat_"+slug+"'>"+title+"</h4><hr/><ul>"
  $.each($cats[slug],function(i,e) {
    item = $content[parseInt(e)-1];
    html += "<li><a>"+item.name+"</a></li>"
  })
  html += "</ul>"
  $("#itms").html(html);
})

function mod(e){
  console.log('mod')
  console.log($(e.target).closest('.mod'))
  if (locale == "tr") {
    showInfo($(e.target).closest('.mod').attr('data-slug').replace('#',''))
  } else if (locale == "en") {
    showInfo($(e.target).closest('.mod').attr('data-slug_en').replace('#',''))
  }
}

function zom(e){
  e.preventDefault();
  m = markers[$(e.target).data('slug')]
  map.setView(m._latlng,12,{animate:true});
}

function getBack() {
  //map.fitBounds(vectorLayer.getBounds(),fitBoundOpts);
  map.setView(maxBounds.getCenter(),6);
}

function popUp(marker) {
  marker.openPopup();
  //window.location = "#"+marker.slug;
}

